def _verify_path_permissions(
    self,
    path,
    expected_permission,
    support_cli,
    is_folder=False,
    file_type="All",
    exclude=None,
):
    try:
        if is_folder:
            if support_cli.directory_exists(path) != 0:
                return f'Folder "{path}" does not exist', None

            curr_permission = support_cli.get_file_permission(
                path, is_folder=True, file_type=file_type, exclude=exclude
            )

            if "\n" in curr_permission:
                return (
                    f'Mismatched permissions in folder "{path}" for type "{file_type}":\n{curr_permission}',
                    None,
                )

        else:
            if path == hw_constants.HW_DICT["memorylimit_json_base_path"]:
                path += f".{support_cli.get_hardware_model()}"

            base_path, file_name = path.rsplit("/", 1)
            resolved_path = support_cli.get_absolute_path(file_name, base_path)
            if not resolved_path:
                return f'File "{path}" not found at expected location', None

            curr_permission = support_cli.get_file_permission(path)

            if curr_permission not in expected_permission:
                perm_bits = curr_permission.split()[0]
                if "exec" in path and all(perm_bits[i] == "x" for i in [3, 6, 9]):
                    return None, (
                        f'Permissions mismatch for "{path}", '
                        "but executable permissions found for all users"
                    )

        if curr_permission not in expected_permission:
            return (
                f'"{path}" has permissions "{curr_permission}", expected: "{expected_permission}"',
                None,
            )

        return None, None

    except Exception as e:
        return f"Exception while verifying {path}: {e!s}", None
