@pytest.mark.file_permissions
def test_file_permissions(self):
    error, output = [], []
    file_types = hw_constants.EXPECTED_FILE_PERMISSIONS
    folder_files_types = hw_constants.EXPECTED_DIRECTORY_FILES_PERMISSIONS
    secure_login_file_types = hw_constants.EXPECTED_SECURE_LOGIN_FILE_PERMISSIONS

    non_secure_cli = self.support_cli
    secure_cli = helper.instantiate_support_CLI_connection(
        self.cluster_ips[0], self.cluster_config, use_sudo=False
    )

    with concurrent.futures.ThreadPoolExecutor(
        max_workers=MAX_CONCURRENT_CONNECTIONS
    ) as executor:
        futures = []

        for permissions_dict in file_types.values():
            for file_path, expected in permissions_dict.items():
                futures.append(
                    executor.submit(
                        self._verify_path_permissions,
                        file_path,
                        expected,
                        non_secure_cli,
                        is_folder=False,
                    )
                )
                time.sleep(0.2)

        for permissions_dict in secure_login_file_types.values():
            for file_path, expected in permissions_dict.items():
                futures.append(
                    executor.submit(
                        self._verify_path_permissions,
                        file_path,
                        expected,
                        secure_cli,
                        is_folder=False,
                    )
                )
                time.sleep(0.2)

        for folder_info in folder_files_types:
            futures.append(
                executor.submit(
                    self._verify_path_permissions,
                    folder_info["directory"],
                    folder_info["permission"],
                    non_secure_cli,
                    is_folder=True,
                    file_type=folder_info.get("file_extension", "All"),
                    exclude=folder_info.get("file_exclusion"),
                )
            )
            time.sleep(0.2)

        for future in concurrent.futures.as_completed(futures):
            err, out = future.result()
            if err:
                error.append(err)
            if out:
                output.append(out)

    assert not error, "Failed with error: {}".format("\n".join(error))
    logger.info("File permissions and locations are as expected")
    if output:
        logger.info("Special cases: %s", "\n".join(output))
